import "./card.css"
function Card(){
  return (
    <section className="card">
      <a href="https://www.youtube.com/watch?v=B_nq7VTJZds" rel="noreferrer noopener"
      target="_blank">
        <img src="https://img.youtube.com/vi/B_nq7VTJZds/mqdefault.jpg" alt="Capa"/>
      </a>
    </section>
  )
}

export default Card
